  false,\n\t\"url\": null,\n\t\"notes\": \"This wildlife inventory plan for Fish Springs
  National Wildlife Refuge was designed to guide continued development of the refuge
  and wildlife management.  Wildlife inventory procedures are provided for monthly
  waterfowl census, pair counts and brood counts for geese and ducks, shorebird census,
  predaceous bird census, mourning dove census, monthly mammal survey, nesting survey,
  and muskrat inventory. Maps of survey units, survey route  maps, and aerial photos
  of the refuge are included in this plan.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
